					tl.to(
						".saruHello",
						{
							duration: 0,
							delay: 10,
							text: "うさぎさんのイラストにぼくを合わせて、助けるボタンを押してね"
						},
						3
					);
				}
				tl.to(".saruHello", { duration: 1, opacity: 1 });
				tl.to(".overlay", { duration: 1, display: "none" });
			},
			kumaSaru() {
				let tl = gsap.timeline();
