					duration: 1.5,
					ease: "elastic.out(1, 1)",
					y: 600,
					delay: 1
				});
				tl.to(".saruHello", { duration: 1, opacity: 1 });
				tl.to(".saruHello", { duration: 4, opacity: 1 });
				setTimeout(() => {
					this.showMiddle = false;
				}, 6000);
			},
			risuSaru() {
				let tl = gsap.timeline();
				tl.to(".helloSaruImages, .saruHello", {
					duration: 1.5,
					ease: "elastic.out(1, 1)",
					y: 600,
					delay: 1
				});
				tl.to(".saruHello", { duration: 1, opacity: 1 });
				tl.to(".saruHello", { duration: 4, opacity: 1 });
				setTimeout(() => {
					this.showEnd = false;
				}, 7000);
			},
