			story2() {
				//usagiの汗の動き
				let story2tl = gsap.timeline();
				story2tl.to("#usagiWords", { duration: 1.5, opacity: 1, scale: 1.05 });
				story2tl.to("#usagiWords", { duration: 0.2, opacity: 1, scale: 1 });
				story2tl.to("#exclamationMark", {
					duration: 0.2,
