				//usagiの汗の動き
				let asetl = gsap.timeline();
				asetl.to("#UsagiAse", { duration: 1.5, opacity: 0, y: 20, x: 10 });
				asetl.repeat(3);
				// さるとうさぎのセリフの動き
				let wordstl = gsap.timeline();
				wordstl.to("#usagiWords", { duration: 1, opacity: 1, scale: 1.05 });
				wordstl.to("#usagiWords", { duration: 0.1, scale: 1.04 });
				wordstl.to("#saruWords", {
					duration: 0.7,
					opacity: 1,
					scale: 1.02,
					delay: 1
				});
				wordstl.to("#saruWords", { duration: 0.1, scale: 1.01 });
				wordstl.to("#saru", { duration: 0.1, y: -20 });
				wordstl.to("#saru", { duration: 0.1, y: 20 });
				wordstl.to("#saru", { duration: 0.1, y: -20 });
				wordstl.to("#saru", { duration: 0.1, y: 20 });
				wordstl.to("#story3", { duration: 1, delay: 2, opacity: 0.1 });
				wordstl.to(".modalSlide:nth-of-type(3) .buttons", { duration: 1, opacity: 1 });
			}
		},
		created() {
			gsap.registerPlugin(TextPlugin);
		},
		mounted() {
			setTimeout(() => {
				this.story1();
			}, 2000);

			this.story1();

			setTimeout(() => {
